    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Cuando se crea un nuevo t\u00fanel de servicio o se ejecuta un servicio por primera vez (por ejemplo, el servidor web Jetty predeterminado, complementos), se crea una clave de encriptaci\u00f3n privada que controla esencialmente la propiedad de la direcci\u00f3n. Generalmente recibe el nombre <code>&hellip;privKey.dat</code> o <code>eepPriv.dat</code>, aunque es una buena idea cambiar el nombre para indicar el servicio al que pertenece y luego vuelva a especificarlo en la configuraci\u00f3n del servidor del Administrador de T\u00faneles. \u00a1Este archivo .dat debe respaldarse de forma segura; perderlo har\u00e1 que pierdas la propiedad y el control de tu nombre de host!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Esta configuraci\u00f3n permite la configuraci\u00f3n del n\u00famero m\u00e1ximo de archivos por torrent que permitir\u00e1 I2PSnark, al descargar o crear un torrent. Tenga en cuenta que aumentar sustancialmente este valor desde el predeterminado de 2000 archivos puede requerir configuraci\u00f3n adicional en el sistema anfitri\u00f3n para aumentar el n\u00famero m\u00e1ximo de archivos abiertos que permitir\u00e1 el sistema operativo (p. ej. <code>ulimit -n</code> en Linux). Para cambiarlo, agr\u00e9guelo al archivo de configuraci\u00f3n de I2PSnark <code>i2psnark.config</code>. [Se requiere reiniciar I2PSnark o el enrutador]";
