    t[621] = "Aunque I2P funcionar\u00e1 bien con esta configuraci\u00f3n, si de veras tiene m\u00e1s de 128 KB/s de ancho de banda para compartir, ser\u00e1 mucho m\u00e1s \u00fatil a la red si abre los puertos en su cortafuegos.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Una aplicaci\u00f3n de l\u00ednea de comandos suministrada con I2P que se usa para solicitar recursos de URL, similar a <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> o <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget tambi\u00e9n se usa internamente por el enrutador, por ejemplo para volver a sembrar desde hosts remotos. Por defecto, eepget usa el proxy HTTP en <code>127.0.0.1:4444</code>.";
