    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Un eepsite es un sitio web alojado de forma an\u00f3nima en la red I2P - puedes acceder a \u00e9l configurando tu navegador web para usar el proxy HTTP de I2P (ve arriba) y navegando al sitio web con el sufijo <code>.i2p</code> (p. ej. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Aseg\u00farate tambi\u00e9n de que tu navegador est\u00e9 configurado para resolver DNS de forma remota al usar el proxy para evitar fugas de DNS.";
