    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Tu servidor web se ejecuta de forma predeterminada en <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, pero no es accesible para otros hasta que inicio el t\u00fanel <i>Servidor Web I2P</i>. Despu\u00e9s de iniciar el t\u00fanel, tu sitio ser\u00e1 dif\u00edcil de encontrar para otras personas. Podr\u00edas simplemente decirle a la gente el destino o la direcci\u00f3n Base32, pero afortunadamente I2P tiene una libreta de direcciones para almacenar nombres de dominio, y varios servicios donde puedes <a href=/help/hostnameregistration>registrar un nuevo dominio .i2p</a> de forma gratuita.";
