    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "La siguiente definici\u00f3n de umbral <i class=example>180/60</i> especifica que el mismo destino remoto puede realizar 179 intentos de conexi\u00f3n durante un per\u00edodo de 60 segundos. Si realiza un intento m\u00e1s dentro del mismo per\u00edodo, el umbral se violar\u00e1 y se rechazar\u00e1n m\u00e1s intentos de conexi\u00f3n hasta el final del per\u00edodo:";
