    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P selecciona un puerto aleatorio entre 9000 y 31000 para comunicarse con otros enrutadores cuando el programa se ejecuta por primera vez, o cuando cambia tu direcci\u00f3n IP externa al ejecutarse en <a href=/confignet#ipchange>modo port\u00e1til</a>. El puerto <a href=/confignet#udpconfig>seleccionado</a> se muestra en la <a href=/confignet>p\u00e1gina de configuraci\u00f3n de red</a>.";
