    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Tu enrutador necesitar\u00e1 al menos 10 minutos desde su inicio para aceptar la construcci\u00f3n de t\u00faneles de participaci\u00f3n con el fin de garantizar que el enrutador es estable y se ha integrado correctamente en la red.";
