    t[2246] = "A gentle introduction to I2P";
    t[2247] = "Una suave introducci\u00f3n a I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Cu\u00e1nto tiempo deben esperar los trabajos antes de su ejecuci\u00f3n. La cola de trabajos se enumera en la p\u00e1gina <a href='/jobs'>Trabajos</a>. Desafortunadamente, hay varias otras colas de trabajos en el enrutador que pueden saturarse, y su estado no est\u00e1 disponible en la consola del enrutador. El retardo de trabajos generalmente deber\u00eda ser cero. Si es consistentemente superior a 500ms, tu computadora es muy lenta, tu red est\u00e1 experimentando problemas de conectividad o el enrutador tiene problemas graves. <a href='/configstats#jobQueue.jobLag'>[Habilitar gr\u00e1ficos]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Configure las actualizaciones de I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Antes de contarle al mundo sobre tu nuevo sitio web, deber\u00edas agregar alg\u00fan contenido. Ve al directorio ra\u00edz del servidor <a href=#rootdir>listado anteriormente</a> y reemplaza la p\u00e1gina de redirecci\u00f3n <i>index.html</i> con tu propio contenido. Si necesitas una plantilla para un sitio b\u00e1sico, si\u00e9ntete libre de adaptar <a href=http://127.0.0.1:7658/help/pagetemplate.html>esta p\u00e1gina</a>. Si eres redirigido a esta p\u00e1gina despu\u00e9s de editar el contenido, intenta limpiar la cach\u00e9 web de tu navegador.";
