    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Si su enrutador tiene 10 o m\u00e1s peers activos, todo est\u00e1 bien. El enrutador debe mantener conexiones con unos pocos peers en todo momento. La mejor manera de permanecer \"mejor conectado\" a la red es <a href=/config>compartir m\u00e1s ancho de banda</a>.";
