    t[2371] = "Glosario";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Para obtener tu propio nombre de host, registradores de dominios I2P como <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> o <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> ofrecen servicios de registro que te permiten registrar y administrar un nombre de host o subdominio .i2p, que luego se propagar\u00e1 en toda la red. Algunos sitios de registro requerir\u00e1n la direcci\u00f3n de destino <i>B64</i> del t\u00fanel/servicio con el que desees asociar un nombre de host, el cual deber\u00edas copiar de la secci\u00f3n <i>Destino local</i> en la p\u00e1gina de configuraci\u00f3n del <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Administrador de T\u00faneles</a>.";
