    t[2471] = "Control manual de los pares";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Esto indica la cantidad de RAM que est\u00e1 utilizando I2P y la cantidad total disponible, asignada por Java. Si el uso es consistentemente alto en relaci\u00f3n con la RAM disponible, esto puede indicar que necesitas aumentar la RAM asignada a la JVM. Puedes asignar m\u00e1s RAM editando tu archivo <code>wrapper.config</code>, que normalmente se encuentra en el directorio de aplicaci\u00f3n de I2P. Deber\u00e1s editar el par\u00e1metro <code>wrapper.java.maxmemory</code>, que por defecto est\u00e1 configurado a 256(MB) para I2P o 384 para I2P+. Nota: si se habilita la barra de memoria, la entrada de memoria en la secci\u00f3n de informaci\u00f3n del enrutador ser\u00e1 suprimida.";
