    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "Debajo de <i>Configurar acceso de proxy a Internet</i>, seleccione la opci\u00f3n <i>Configuraci\u00f3n manual del proxy</i>.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Para servir tu propio contenido est\u00e1tico, solo necesitas editar o reemplazar los archivos en el directorio ra\u00edz del servidor web, y el sitio estar\u00e1 disponible en la red I2P despu\u00e9s de seguir las instrucciones a continuaci\u00f3n. Adem\u00e1s, los scripts cgi y python se pueden ejecutar desde el directorio <code>cgi-bin</code> inmediatamente por encima de <code>docroot</code> si tienes instalados <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> y <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a>.";
