    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Muchas de las estad\u00edsticas en la barra lateral se pueden <a href='/configstats'>configurar</a> para que se <a href='/graphs'>grafiquen</a> para un an\u00e1lisis m\u00e1s profundo. Tambi\u00e9n puedes personalizar las secciones que aparecen en la barra lateral y su posicionamiento en la <a href='/configsidebar'>p\u00e1gina de configuraci\u00f3n de la barra lateral</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Esta configuraci\u00f3n espec\u00edfica del t\u00fanel te permite habilitar o deshabilitar las respuestas a los pings enviados a los servidores alojados por el enrutador. Para deshabilitar los pings, debes agregar la l\u00ednea <code>i2p.streaming.answerPings=false</code> a la secci\u00f3n <i>Opciones personalizadas</i> de la configuraci\u00f3n del servidor en el Administrador de t\u00faneles.";
