    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Esta configuraci\u00f3n (en segundos) te permite anular el retardo entre ejecuciones del Trabajo de exploraci\u00f3n de pares que intenta localizar nuevos pares para agregar a NetDb. El trabajo se ejecutar\u00e1 cada 80 segundos de forma predeterminada, o si el enrutador experimenta retrasos en trabajos o mensajes, cada 3 minutos. Si el tama\u00f1o de NetDb alcanza 4000 pares, la pausa aumentar\u00e1 a 15 minutos. Puede que desees aumentar el retardo si tu NetDb tiene muchos contactos (m\u00e1s de 2000 pares), o si deseas reducir el uso general de ancho de banda. Nota: Para los enrutadores punto de inundaci\u00f3n, este trabajo no se ejecuta.";
    t[2698] = "Current";
    t[2699] = "Actual";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Un sitio web alojado en la red I2P. Por defecto, un <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>servidor web Jetty</a> est\u00e1 configurado y ejecut\u00e1ndose en <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Puede deshabilitarse o cambiarse en el <a href=/i2ptunnelmgr>Gestor de t\u00faneles</a>. Tambi\u00e9n puede configurarse para unirse a una interfaz espec\u00edfica o a todas las interfaces.";
