    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Para acceder a sitios web alojados en I2P y, opcionalmente, usar el proxy de salida predeterminado para conectarse a sitios web en clearnet, deber\u00e1 configurar su navegador para usar el proxy HTTP de I2P, que se ejecuta de forma predeterminada en <code>127.0.0.1 puerto 4444</code>. La mayor\u00eda de los navegadores ofrecen una opci\u00f3n para configurar su proxy; en este mini tutorial nos centraremos en Firefox.";
    t[2776] = "Close to us";
