    t[2796] = "Streaming radio service";
    t[2797] = "Servicio de radio en streaming";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "\u00a1I2P+ funciona mejor cuando puedes reflejar con precisi\u00f3n la velocidad de tu conexi\u00f3n de red en la secci\u00f3n de <a href=/config>configuraci\u00f3n de ancho de banda</a>. Por defecto I2P+ se configura con valores bastante conservadores que no se ajustar\u00e1n a muchos casos de uso, as\u00ed que por favor t\u00f3mate el tiempo de revisar estos ajustes y corregirlos donde sea necesario. \u00a1Cuanto m\u00e1s ancho de banda asignes, <i>espec\u00edficamente</i> ancho de banda de subida, m\u00e1s beneficiar\u00e1s de la red!";
