    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "El Protocolo de Red I2P (I2NP) gestiona el enrutamiento y mezcla de mensajes entre enrutadores, adem\u00e1s de la selecci\u00f3n del transporte (cuando se apoya m\u00e1s de uno) al comunicarse con un par. Para m\u00e1s informaci\u00f3n, consulta la <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>documentaci\u00f3n en l\u00ednea</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Caduc\u00f3 hace {0}";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "El estado de tu enrutador al aceptar o rechazar solicitudes de otros enrutadores para construir un t\u00fanel de participaci\u00f3n a trav\u00e9s de tu enrutador. Tu enrutador puede aceptar todas las solicitudes, aceptar o rechazar un porcentaje de solicitudes o rechazar todas las solicitudes por varias razones, para controlar el ancho de banda y las demandas de CPU y mantener la capacidad para clientes locales. <b>Nota:";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Por favor, contacta con un amigo de confianza que use I2P y p\u00eddele ayuda para resembrar tu router I2P. P\u00eddele que te env\u00ede un archivo de resembrado exportado desde su router I2P activo. Es vital que el archivo sea enviado por un canal seguro, por ejemplo cifrado, para evitar alteraciones externas (firma PGP, cifrado y verificado con una clave p\u00fablica de confianza). El archivo en s\u00ed no va firmado, por lo que s\u00f3lo debes aceptar archivos de amigos de confianza. Nunca importes un archivo de resembrado si no puedes verificar la fuente.";
    t[2916] = "Last Good Send";
    t[2917] = "\u00daltimo env\u00edo correcto";
    t[2918] = "Delete this value to disable";
    t[2919] = "Elimine este valor para desactivarlo";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Puedes usar un registrador en un t\u00fanel que escribe en un archivo que otro t\u00fanel, o varios t\u00faneles, pueden usar para limitar. Estos archivos tambi\u00e9n se pueden editar manualmente.";
