    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Las aplicaciones web Java listadas debajo son iniciadas por el cliente webConsole y ejecutadas en la misma JVM que el router. Habitualmente son aplicaciones web accesibles a trav\u00e9s de la consola del router. Pueden ser aplicaciones completas (ej. i2psnark), interfaces de otro cliente o aplicaci\u00f3n que deber\u00eda habilitarse por separado (ej. susidns, i2ptunnel), o no tienen interfaz web en absoluto (ej. addressbook).";
