    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Este es el n\u00famero total de pares que conoce tu enrutador. Se listan en la p\u00e1gina <a href='/netdb'>Base de datos de red</a>. Puede variar desde menos de 100 hasta 1000 o m\u00e1s. Este n\u00famero no es el tama\u00f1o total de la red; puede variar ampliamente dependiendo de tu ancho de banda total, ancho de banda compartido y tr\u00e1fico generado localmente. I2P no requiere que un enrutador conozca a todos los dem\u00e1s enrutadores de la red.";
