    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Puedes anular la <a href=http://127.0.0.1:7658/help/images/>apariencia predeterminada</a> del listado de directorios suministrando un archivo <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> editado para establecer una apariencia global. Ten en cuenta que este archivo no se mostrar\u00e1 en el listado de directorios del servidor web. Los archivos y directorios precedidos por . y los archivos llamados favicon.ico o archivos que terminen con ~ o .bak o .old tambi\u00e9n se ocultar\u00e1n de la vista (aunque sigan siendo accesibles). Nota: para crear archivos ocultos con el prefijo . en Windows, agrega un punto al final al archivo o directorio, p.ej. <code>.hidden.</code>; el explorador de Windows guardar\u00e1 el archivo con el nombre correcto, eliminando el punto al final del proceso.";
