    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Cuando se establece en true, se habilitar\u00e1 funcionalidad adicional en la consola y el usuario podr\u00e1 editar directamente las configuraciones en la p\u00e1gina <a href=/configadvanced>Configuraci\u00f3n avanzada</a>. Se proporcionan opciones de visualizaci\u00f3n adicionales en la secci\u00f3n <a href=/netdb>Base de datos de red</a>, incluida la herramienta de <a href='/netdb?f=3'>An\u00e1lisis Sybil</a>, y existen opciones de configuraci\u00f3n adicionales en la p\u00e1gina <a href=/configclients>Configuraci\u00f3n de clientes</a>. Esto tambi\u00e9n permitir\u00e1 la instalaci\u00f3n de actualizaciones no firmadas, la configuraci\u00f3n manual de la URL de noticias y secciones adicionales en la barra lateral.";
