    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Este es el n\u00famero de pares que tiene disponible tu enrutador para construir t\u00faneles cliente. Generalmente est\u00e1 entre 8-30. Tus pares r\u00e1pidos se muestran en la p\u00e1gina <a href='/profiles'>Perfiles</a>. <a href='/configstats#router.fastPeers'>[Habilitar gr\u00e1ficos]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Pulsa el bot\u00f3n <i>Resembrar desde archivo</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Una variante del enrutamiento cebolla que cifra varios mensajes juntos para dificultar el an\u00e1lisis de tr\u00e1fico por atacantes y aumentar la velocidad de transferencia de datos. Para m\u00e1s informaci\u00f3n, consulta la <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>documentaci\u00f3n en l\u00ednea</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "C\u00f3mo Fortalecer Tu Sitio WordPress";
    t[3496] = "I2P Internals";
    t[3497] = "Configuraci\u00f3n interna de I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Por defecto, I2P incluye un servidor web para alojar tu propio sitio web anonimizado (tradicionalmente conocido como un <i>eepsite</i>). Tanto el sitio como la consola del enrutador I2P se ejecutan en una versi\u00f3n simplificada de <a href='https://es.wikipedia.org/wiki/Jetty_(servidor_web)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, personalizada para I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Esta configuraci\u00f3n te permite excluir enrutadores m\u00e1s antiguos de tu NetDb. Los enrutadores m\u00e1s antiguos que el predeterminado o el valor que establezcas se eliminar\u00e1n de NetDb y se prohibir\u00e1n durante la sesi\u00f3n del enrutador. De forma predeterminada, se excluyen los enrutadores m\u00e1s antiguos que la versi\u00f3n 0.9.20. Nota: a partir de la versi\u00f3n I2P+ 0.9.46+, solo se usan enrutadores con versiones muy recientes para construir t\u00faneles locales. [Reinicio requerido]";
