    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Algunos clientes IRC est\u00e1n configurados para desconectarse del servidor si no hay comunicaci\u00f3n con \u00e9l durante un periodo de tiempo, lo que en ocasiones puede ser un problema para IRC de I2P si el valor de <i>tiempo de espera de ping</i> est\u00e1 establecido demasiado bajo. Establecer el valor de tiempo de espera de ping en tu cliente en un valor alto (p.ej. 320 segundos) generalmente dar\u00e1 como resultado una conexi\u00f3n m\u00e1s robusta a la red. En HexChat puedes configurar el valor escribiendo <code>/set net_ping_timeout 320</code>. Esto escribir\u00e1 el valor en tu archivo <code>hexchat.conf</code>.";
    t[3964] = "Run at Startup?";
    t[3965] = "\u00bfEjecutar en el arranque?";
