    t[3973] = "Nunca";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Una <a href=/confignet#ipchange>configuraci\u00f3n opcional</a> que cambia autom\u00e1ticamente tu <a href=/netdb?r=.>identidad de router</a> y el <a href=/confignet#udpconfig>puerto externo</a> cuando cambia la direcci\u00f3n IP p\u00fablica de tu sistema. Esto puede evitar que un adversario correlacione tu identidad de router y direcci\u00f3n IP en escenarios donde tu direcci\u00f3n IP pueda cambiar frecuentemente, por ejemplo cuando ejecutas I2P en una laptop desde m\u00faltiples ubicaciones.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "El router no est\u00e1 configurado para publicitar su direcci\u00f3n, por tanto no espera conexiones entrantes.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "Una aplicaci\u00f3n de l\u00ednea de comandos suministrada con I2P+ (Linux/MacOS) que se usa para realizar una solicitud <code>head</code> sobre un recurso http especificado en la red, devolviendo varios encabezados de respuesta del servidor remoto. Por defecto, eephead usa el proxy HTTP en <code>127.0.0.1:4444</code>.";
