    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (TCP basado en NIO) y NTCP2 son transportes de red basados en TCP que usan la implementaci\u00f3n TCP de Java NIO (Entrada/Salida Nueva) para entregar mensajes I2NP entre enrutadores en la red. NTCP2 mejora la resistencia de NTCP a diversos ataques y m\u00e9todos de identificaci\u00f3n autom\u00e1tica de tr\u00e1fico. Para m\u00e1s informaci\u00f3n, consulta la <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>documentaci\u00f3n en l\u00ednea</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Puedes usar un registrador para registrar los destinos de clientes agresivos en un archivo espec\u00edfico, y luego usar ese mismo archivo para limitarlos. El siguiente fragmento define un filtro que inicialmente permite todas las solicitudes de conexi\u00f3n, pero si alg\u00fan destino \u00fanico supera las 180 solicitudes en 60 segundos, se limita a 30 solicitudes cada 60 segundos:";
