    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Esta configuraci\u00f3n, cuando se configura con una ruta que apunte a un archivo de lista de bloqueo v\u00e1lido, habilita una lista de bloqueo adicional configurada por el usuario para cargarse en el inicio del enrutador. [Deshabilitado de forma predeterminada, se requiere reinicio]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ admite anulaciones personalizadas de tema para la consola, el administrador de t\u00faneles, I2PSnark, SusiDNS y Susimail, permitiendo cambios en los temas que persisten despu\u00e9s de las actualizaciones. Para activar una anulaci\u00f3n, crea un archivo css llamado <code>override.css</code> con tus modificaciones tem\u00e1ticas y col\u00f3calo en el directorio de temas correspondiente del tema que deseas cambiar, o renombra uno de los archivos de ejemplo, y luego actualiza completamente el navegador. Ten en cuenta que el administrador de t\u00faneles y la consola comparten el mismo archivo override.css. Para desactivar una anulaci\u00f3n, elimina o renombra el archivo <code>override.css</code> y luego actualiza completamente el navegador (normalmente Control + May\u00fas + R).";
