    t[5085] = "Si est\u00e1s ejecutando un sitio din\u00e1mico manejando un gran n\u00famero de usuarios concurrentes, el almacenamiento en cach\u00e9 de contenido a menudo puede mejorar el tiempo para entregar p\u00e1ginas. Para contenido que cambia r\u00e1pidamente, una <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>estrategia de micro-cacheo</a> a\u00fan puede dar algunos beneficios. El servidor web <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx</a> proporciona un competente subsistema de cach\u00e9, o para una soluci\u00f3n m\u00e1s pesada, echa un vistazo a <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
