    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Si despu\u00e9s de unos minutos de funcionamiento su enrutador indica 0 peers activos y 0 peers conocidos, con una notificaci\u00f3n en la barra lateral de que debe verificar su conexi\u00f3n de red, compruebe que puede acceder a Internet. Si su conexi\u00f3n a Internet funciona, es posible que necesite desbloquear Java en su cortafuegos. De lo contrario, es posible que deba volver a sembrar su enrutador I2P. Visite la p\u00e1gina <a href=/configreseed#reseedconfig>Reseed Configuration</a> y haga clic en el bot\u00f3n <i>Guardar cambios y volver a sembrar ahora</i>. Para m\u00e1s informaci\u00f3n, consulte la secci\u00f3n <a href=#reseedhelp>Ayuda para volver a sembrar</a> anterior.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Una API de sockets de nivel superior para clientes. Solo se abre cuando un cliente SAM V3 solicita una sesi\u00f3n UDP. Puede habilitarse/deshabilitarse en la p\u00e1gina <a href=/configclients>Configuraci\u00f3n de clientes</a>. Puede cambiarse en el archivo <code>clients.config</code> con la opci\u00f3n de l\u00ednea de comandos SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Si quieres que tu sitio se sienta r\u00e1pido, la compresi\u00f3n de im\u00e1genes es esencial al alojar archivos grandes. Usar un servicio como <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> para comprimir tus im\u00e1genes png y jpeg usualmente resultar\u00e1 en archivos mucho m\u00e1s peque\u00f1os con una p\u00e9rdida m\u00ednima de calidad. En algunas situaciones, el formato webp puede ser mejor que los jpegs, generando archivos m\u00e1s peque\u00f1os con aproximadamente la misma o mejor fidelidad visual, y tiene un amplio soporte en navegadores. Tambi\u00e9n considera usar svg en lugar de bitmaps para \u00edconos e ilustraciones - suelen ser m\u00e1s peque\u00f1os que el archivo bitmap equivalente (p\u00e1salos a trav\u00e9s de un servicio como <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> para remover basura innecesaria), se escalan sin p\u00e9rdida de calidad y pueden ser comprimidos por tu servidor web.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP deshabilitado en el dispositivo";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "De forma predeterminada, la mayor\u00eda de sus servicios cliente (correo, proxy HTTP, IRC) compartir\u00e1n el mismo conjunto de t\u00faneles (por razones de rendimiento) y se enumerar\u00e1n como <i>Clientes compartidos</i> y <i>Clientes compartidos (DSA)</i> en la barra lateral bajo T\u00faneles de servicio y en la p\u00e1gina <a href=/tunnels>T\u00faneles</a>.";
