    t[5681] = "Configurar el servicio del sistema I2P";
    t[5684] = "Check to see if another program is using the configured port. If so, stop that program or configure I2P to use a different port.";
    t[5685] = "Compruebe si otro programa est\u00e1 utilizando el puerto configurado. Si es as\u00ed, cierre el programa o configure I2P para utilizar un puerto diferente.";
    t[5692] = "Manually edit peers and view banned peers and blocklist";
    t[5693] = "Editar pares manualmente y ver pares bloqueados y lista negra";
    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "ADVERTENCIA-Bloqueado por cortafuegos con TCP entrante habilitado";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Abre el <a href=/confignet#udpconfig>puerto de I2P+</a> en tu m\u00f3dem, enrutador y/o cortafuegos para una mejor conectividad (idealmente tanto UDP como TCP). En <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a> se puede encontrar m\u00e1s informaci\u00f3n sobre c\u00f3mo configurar el reenv\u00edo de puertos, adem\u00e1s de nuestros foros e IRC enumerados a continuaci\u00f3n. Ten en cuenta que I2P no admite conectarse a Internet a trav\u00e9s de un proxy HTTP o SOCKS [\u00a1aceptamos parches!], aunque s\u00ed puedes conectarte a proxies a trav\u00e9s de I2P una vez conectado a la red.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Un filtro de t\u00faneles puede brindar protecci\u00f3n contra ataques de denegaci\u00f3n de servicio, sin interrumpir de otra manera el servicio para usuarios leg\u00edtimos, ya sea en conjunto con el limitador de t\u00faneles o como una estrategia alternativa. Tambi\u00e9n se puede utilizar para registrar el acceso a un servicio alojado para determinar si el servidor est\u00e1 bajo ataque, o simplemente para registrar todos los visitantes por destino I2P. Adem\u00e1s, un filtro puede funcionar simult\u00e1neamente como lista blanca y negra, lo que lo hace m\u00e1s flexible que los controles de lista de acceso del Administrador de T\u00faneles. Ten en cuenta que m\u00faltiples t\u00faneles de servidor pueden compartir un \u00fanico archivo de filtro si deseas implementar un filtro global.";
