    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Esta configuraci\u00f3n (en milisegundos) le permite configurar manualmente el retardo entre las actualizaciones de actualizaci\u00f3n de enrutadores ejecutadas por el Trabajo de actualizaci\u00f3n de enrutadores. De forma predeterminada, la pausa entre actualizaciones se determina seg\u00fan el tama\u00f1o de NetDb e introduce cierta aleatoriedad en la programaci\u00f3n para mitigar el an\u00e1lisis de tr\u00e1fico. Para valores inferiores a 2000 milisegundos, se recomienda aumentar el valor de <code>router.refreshTimeout</code>. Ten en cuenta que establecer este valor por debajo de 2000 milisegundos aumentar\u00e1 su tr\u00e1fico de red y puede introducir retrasos en trabajos, y no se recomienda para uso continuado.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Los t\u00faneles de servidor, configurables en el <a href=/i2ptunnelmgr>Administrador de T\u00faneles</a>, ofrecen varias formas de limitar el acceso al servicio alojado. La lista blanca y negra de destinos, el limitador de conexiones y el filtrado de t\u00faneles son m\u00e9todos previstos para mitigar ataques de denegaci\u00f3n de servicio, otorgar acceso exclusivo a destinos I2P conocidos y administrar el tr\u00e1fico al servidor.";
