    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "\u00a1I2P+ puede ser lento para integrarse en la red por primera vez que lo ejecutes ya que se inicializa en la red y aprende sobre peers adicionales. \u00a1Cuanto m\u00e1s tiempo lleve funcionando tu enrutador I2P+, mejor funcionar\u00e1, as\u00ed que intenta dejarlo encendido todo el tiempo que puedas, las 24 horas los 7 d\u00edas si es posible! Si, despu\u00e9s de 30 minutos, tu cantidad de <i>Activo: [conectado/reciente]</i> todav\u00eda tiene menos de 10 peers, o tu n\u00famero total de peers <i>Integrados</i> es menor a 5, hay varias cosas que puedes hacer para verificar problemas:";
