    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Una implementaci\u00f3n en Java de un cliente Tor, disponible como un complemento de I2P. Puede usarse como <i>outproxy</i> predeterminado si se configura en el t\u00fanel SOCKS o HTTP cliente correspondiente en el <i>Administrador de T\u00faneles</i>. Disponible desde <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. El c\u00f3digo fuente est\u00e1 disponible en <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "Direcciones IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Esta secci\u00f3n indica tus velocidades de ancho de banda promedio y el uso total para la sesi\u00f3n. Todos los valores son en bytes por segundo. Puedes cambiar los l\u00edmites de ancho de banda en la p\u00e1gina de <a href='/config'>Configuraci\u00f3n de ancho de banda</a>. Cuanto m\u00e1s ancho de banda pongas a disposici\u00f3n, m\u00e1s ayudas a la red y mejoras tu propio anonimato, por lo que dedica tiempo a revisar la configuraci\u00f3n. Si no est\u00e1s seguro de la velocidad de tu red, usar un servicio como <a href='http://speedtest.net/'>SpeedTest</a> o similar te dar\u00e1 una buena indicaci\u00f3n de tu capacidad de ancho de banda. Tu cantidad de compartici\u00f3n de subida (KBps de salida) determinar\u00e1 tu contribuci\u00f3n total a la red. El ancho de banda se grafica de forma <a href='/graphs'>predeterminada</a>.";
