    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Esta configuraci\u00f3n te permite establecer el n\u00famero m\u00ednimo de t\u00faneles participativos alojados antes de que el enrutador empiece a rechazar solicitudes de t\u00fanel en funci\u00f3n de los requisitos de ancho de banda anticipados. [Predeterminado es 100 si el sistema est\u00e1 ejecutando Android, 800 si el sistema est\u00e1 ejecutando ARM y menos de 4 n\u00facleos disponibles, 1200 si el sistema est\u00e1 ejecutando ARM y 4 o m\u00e1s n\u00facleos disponibles, de lo contrario 2500]";
