    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "I2P no funciona bien detr\u00e1s de este tipo de cortafuegos. Probablemente no podr\u00e1 aceptar conexiones entrantes, lo que limitar\u00e1 su participaci\u00f3n en la red.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "El Protocolo Cliente I2P (I2CP) permite que aplicaciones externas (clientes) se comuniquen con I2P a trav\u00e9s de un \u00fanico socket TCP, usando por defecto el puerto 7654. Para m\u00e1s informaci\u00f3n, consulta la <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>documentaci\u00f3n en l\u00ednea</a>.";
