    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Esta configuraci\u00f3n determina qu\u00e9 transporte tiene prioridad al comunicarse con pares. De forma predeterminada, se favorece NTCP sobre UDP (SSU). Al establecer el valor en true, se favorecer\u00e1 UDP a menos que exista una conexi\u00f3n NTCP preexistente; cuando se establece en siempre, siempre se usar\u00e1 UDP independientemente de cualquier conexi\u00f3n NTCP preexistente. [Predeterminado es false]";
