    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Cuando se establece en true, I2P se ejecuta sin conectividad de red, lo que es \u00fatil si est\u00e1s reiniciando constantemente el enrutador para probar actualizaciones de c\u00f3digo, ya que esto evita la interrupci\u00f3n de la red.";
