    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (UDP Semiseguro Seguro) es un transporte de red I2P que proporciona conexiones punto a punto cifradas y orientadas a conexi\u00f3n, adem\u00e1s de servicios de detecci\u00f3n de direcciones IP y traversal de NAT. Para m\u00e1s informaci\u00f3n, consulta la <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>documentaci\u00f3n en l\u00ednea</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Ventana de congesti\u00f3n";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Usar proxy para resembrar";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Hasta la aparici\u00f3n de la integraci\u00f3n de I2P en <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, no era posible descargar torrents que no estuvieran alojados en la red I2P. Sin embargo, ahora que Vuze (y posteriormente <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) permiten a los usuarios compartir torrents no I2P en I2P, los torrents no I2P se pueden descargar a trav\u00e9s de I2P si los usuarios de Vuze/Bigly han decidido poner el contenido a disposici\u00f3n de la red I2P. Los torrents populares con un gran n\u00famero de pares son m\u00e1s susceptibles de ser accesibles a trav\u00e9s de I2P; para determinar si el contenido est\u00e1 disponible, a\u00f1ade el enlace del torrent, magnet o infohash a tu cliente de BitTorrent habilitado para I2P.";
