    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "Esta configuraci\u00f3n (en horas) determina cu\u00e1n antigua es una RouterInfo en el NetDb (su \u00faltima fecha de publicaci\u00f3n conocida) antes de que se clasifique como obsoleta y se elimine. [Predeterminado son 28 horas a menos que el enrutador sea un punto de inundaci\u00f3n, en cuyo caso el predeterminado son 8 horas]";
