    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Si se solicita una cadena de <i>Autenticaci\u00f3n de Registro</i>, se puede encontrar en la p\u00e1gina <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Autenticaci\u00f3n de Registro</a> enlazada desde la p\u00e1gina de configuraci\u00f3n del <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Administrador de T\u00faneles</a>. La autenticaci\u00f3n de registro garantiza que solo el propietario pueda registrar o administrar el nombre de host, y es requerida en stats.i2p y reg.i2p.";
    t[7448] = "News &amp; Updates";
    t[7449] = "Noticias y actualizaciones";
    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Si no puedes iniciar el enrutador con <code>i2p/i2prouter start</code>, intenta el script <code>runplain.sh</code> en el mismo directorio. \u00a1Nunca se requieren privilegios de root para ejecutar I2P+! Si necesitas compilar la <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>biblioteca jBigi</a> (lo que es necesario en casos poco frecuentes), consulta la documentaci\u00f3n, visita los foros o visita el <a href=irc://127.0.0.1:6668/saltR class=chatlink>canal de I2P+</a> o el <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>canal IRC de desarrolladores</a>.";
