    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Una base de datos distribuida que contiene informaci\u00f3n de contacto de enrutadores (RouterInfos) e informaci\u00f3n de contacto de destinos (LeaseSets). Un solo enrutador mantiene su propia base de datos (parcial) para comunicarse con otros enrutadores en la red; ning\u00fan enrutador mantendr\u00e1 una lista de todos los enrutadores. Los RouterInfos se almacenan en disco y se leen en memoria cuando el enrutador se inicia o cuando se adquieren nuevos RouterInfos. Tambi\u00e9n se le refiere como <i>NetDb</i>. Para m\u00e1s informaci\u00f3n, consulta la <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>documentaci\u00f3n en l\u00ednea</a>.";
    t[7692] = "Address";
    t[7693] = "Direcci\u00f3n";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Un umbral se define por el n\u00famero de intentos de conexi\u00f3n que un destino remoto puede realizar durante un n\u00famero espec\u00edfico de segundos antes de que se produzca una \"infracci\u00f3n\".";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Clearnet normalmente se refiere a Internet accesible p\u00fablicamente, lo opuesto a la darknet que t\u00edpicamente describe los servicios encriptados y an\u00f3nimos construidos sobre I2P, Tor, etc. Para m\u00e1s informaci\u00f3n, consulta el <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>art\u00edculo de Wikipedia</a>.";
