    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Un enrutador en la red responsable de proporcionar e intercambiar informaci\u00f3n sobre otros enrutadores y servicios en la red. El ancho de banda compartido m\u00ednimo actual para que un enrutador se considere capaz de realizar las funciones de floodfill es de 128 KBytes/seg, aunque es posible anular este requisito y forzar a un enrutador a ser un floodfill en la <a href=/configadvanced>p\u00e1gina de configuraci\u00f3n avanzada</a>. Para m\u00e1s informaci\u00f3n, consulta la <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>documentaci\u00f3n en l\u00ednea</a>.";
