    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Siempre que sea posible, los activos que se usen repetidamente en tu sitio deber\u00edan cargarse desde un archivo externo y no incrustados. Si est\u00e1s usando el mismo CSS en varias p\u00e1ginas, crea un archivo css separado y c\u00e1rgalo en la secci\u00f3n <code>&lt;head&gt;</code> de tus p\u00e1ginas. Esto har\u00e1 que las actualizaciones de dise\u00f1o en tu sitio sean m\u00e1s f\u00e1ciles de gestionar, y tambi\u00e9n permitir\u00e1 que el archivo sea almacenado en cach\u00e9 en el navegador del visitante, lo que resultar\u00e1 en menos demanda de ancho de banda para tu servidor web y cargas de p\u00e1gina m\u00e1s r\u00e1pidas para tus visitantes.";
