    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "Configuraci\u00f3n de I2P+: Red, Firefox, Administrador de T\u00faneles";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Si cree que ha abierto el cortafuegos pero I2P todav\u00eda estima que sigue bloqueado por uno, recuerde que podr\u00eda tener m\u00faltiples cortafuegos, por ejemplo cortafuegos por software o en dispositivos de router externos.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "La palabra clave <i class=example>deny</i>. Este umbral siempre se viola, es decir, no se permitir\u00e1n intentos de conexi\u00f3n.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "registrar visitantes que realizan 90 o m\u00e1s conexiones por minuto";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Ha habilitado el TCP entrante, sin embargo el puerto UDP  est\u00e1 bloqueado por cortafuegos, y por tanto es probable que el puerto TCP tambi\u00e9n est\u00e9 bloqueado.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Este es el n\u00famero de pares que usar\u00e1 tu enrutador para consultas en la base de datos de la red. Generalmente son los enrutadores <i>floodfill</i>, que son los responsables de mantener la integridad de la red. Tus pares bien integrados se muestran en la parte inferior de la p\u00e1gina <a href='/profiles'>Perfiles</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Administrar aplicaciones web";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "TCP saliente desde puertos altos aleatorios hacia puertos TCP remotos arbitrarios.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Cuando inicia I2P, puede tomar algunos minutos arrancar (integrar) su enrutador en la red y encontrar pares adicionales, as\u00ed que tenga paciencia.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "No se ha especificado el archivo. Por favor seleccione un archivo .zip o .su3 v\u00e1lido para resembrar desde \u00e9l.";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
