    t[8323] = "P\u00e1gina del asistente desconocido";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "NTCP y SSU IPv6, con introductores";
    t[8332] = "Messages sent to peer";
    t[8333] = "Mensajes enviados a un par";
    t[8334] = "Function";
    t[8335] = "Funci\u00f3n";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "En la red I2P, los servicios alojados de forma remota se pueden acceder usando una direcci\u00f3n <a href=https://es.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> que termina en \".b32.i2p\", un <i>destino</i> representado como una cadena larga <a href=https://es.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>, o m\u00e1s com\u00fanmente usando un dominio .i2p. Un destino es el equivalente de I2P a una direcci\u00f3n IP, y se muestra en la p\u00e1gina <a href='/i2ptunnel/edit?tunnel=3'>Configuraci\u00f3n del Administrador de T\u00faneles</a>. Puedes compartir tu direcci\u00f3n b32.i2p para permitir que otros accedan a tu sitio web hasta que hayas registrado tu propio dominio .i2p.";
    t[8340] = "Computing-related tutorials";
