    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Para deshabilitar los listados de directorios, encuentra la entrada para <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> en el archivo <code>base-context.xml</code>, ubicado en la carpeta <code>eepsite/contexts</code> (justo encima de la carpeta docroot), y cambia 'true' a 'false' debajo. Para aplicar el cambio inmediatamente, det\u00e9n y reinicia el cliente <i>Servidor Web I2P</i> en la p\u00e1gina <a href=/configclients>Configuraci\u00f3n de clientes</a>. Tambi\u00e9n puedes colocar un archivo <code>index.html</code> vac\u00edo en cualquier directorio expuesto para suprimir los listados de directorios para esa ubicaci\u00f3n.";
