    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Los complementos firmados con la clave criptogr\u00e1fica del desarrollador son el formato recomendado, pero si desea instalar complementos no firmados (.zip) puede establecer esto en true. Tenga en cuenta que a\u00fan puede encontrarse con problemas al intentar instalar un complemento no firmado si el desarrollador ha incluido comprobaciones adicionales en el proceso de compilaci\u00f3n del complemento.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Si tienes ejecutada una instancia Tor localmente, puedes usarla configurando I2P as\u00ed: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
