    t[9052] = "Ready";
    t[9053] = "Listo";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Estos son los servicios locales proporcionados por tu enrutador. Pueden ser clientes iniciados a trav\u00e9s del <a href='/i2ptunnelmgr'>Administrador de t\u00faneles</a> o programas externos conectados a trav\u00e9s de SAM, BOB o directamente a I2CP. Por defecto, la mayor\u00eda de tus servicios de cliente (correo, proxy HTTP, IRC) compartir\u00e1n el mismo conjunto de t\u00faneles y se enumerar\u00e1n como <i>Clientes compartidos</i> y <i>Clientes compartidos (DSA)</i>, lo que mejora el anonimato al mezclar el tr\u00e1fico de todos los servicios compartidos y reduce la sobrecarga requerida para construir y mantener t\u00faneles. Sin embargo, si experimentas un fallo de t\u00fanel, todos tus servicios se desconectar\u00e1n al mismo tiempo, por lo que en algunos escenarios puede que desees configurar los servicios de cliente para que usen su propio conjunto de t\u00faneles. Esto se puede hacer desmarcando la opci\u00f3n <i>Compartir t\u00faneles con otros clientes...</i> que aparece listada bajo <i>Clientes compartidos</i> en la p\u00e1gina de configuraci\u00f3n del servicio de cliente correspondiente en el Administrador de t\u00faneles, tras lo cual deber\u00e1s reiniciar el servicio de cliente desde la <a href='/i2ptunnelmgr'>p\u00e1gina principal del Administrador de t\u00faneles</a> .";
