    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Una aplicaci\u00f3n CGI sencilla que toma un nombre de host como par\u00e1metro y retorna una redirecci\u00f3n 301 a la URL correcta con la cadena <code>?i2paddresshelper=key</code> agregada. El proxy HTTP interpretar\u00e1 la cadena agregada y usar\u00e1 la clave como el destino real. Adem\u00e1s, el proxy almacenar\u00e1 la clave en cach\u00e9 de modo que no sea necesario el auxiliar de direcciones hasta el reinicio, y ofrecer\u00e1 la opci\u00f3n de agregar la direcci\u00f3n resuelta a la libreta de direcciones.";
