    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Esta configuraci\u00f3n (en minutos) le permite configurar manualmente cu\u00e1nto tiempo esperar despu\u00e9s del inicio antes de que se verifique la validez de las RouterInfos en NetDb, despu\u00e9s de lo cual solo se aceptar\u00e1n routers v\u00e1lidos para su inclusi\u00f3n. Cuando ocurre la validaci\u00f3n, las RouterInfos caducadas y los pares no responden solo accesibles a trav\u00e9s de SSU se eliminar\u00e1n de NetDb. [Predeterminado son 60 minutos] Nota: Esta configuraci\u00f3n no tiene relaci\u00f3n con los routers m\u00e1s antiguos (m\u00e1s antiguos que la versi\u00f3n 0.9.29 de forma predeterminada), que se eliminar\u00e1n de NetDb y se prohibir\u00e1n para la sesi\u00f3n del enrutador en cuanto se intente almacenar NetDb.";
