    t[9477] = "Esta configuraci\u00f3n permite la configuraci\u00f3n de servidores NTP alternativos requeridos para garantizar que su enrutador mantenga la hora correcta. [Predeterminado es 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
