    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Si est\u00e1s apurado y no puedes esperar algunas horas, puedes decirle a la gente que use un servicio de redirecci\u00f3n de \"salto\" de ayuda de direcci\u00f3n. Generalmente funcionar\u00e1 en unos pocos minutos despu\u00e9s de registrar tu nombre de host en el mismo sitio. Primero pru\u00e9balo t\u00fa mismo ingresando <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>tumismombrdecost.i2p</i></code> en tu navegador. Una vez que funcione, puedes decirles a otros que lo usen.";
