    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "Ten en cuenta que antes de implementar el filtro debe ser accesible la ruta completa a los archivos de salida. Si el directorio de destino no existe, no se registrar\u00e1n los destinos y aparecer\u00e1 un error en los registros del enrutador. Los archivos se crear\u00e1n seg\u00fan se necesite. Los ejemplos proporcionados anteriormente no son recomendaciones; tu configuraci\u00f3n debe ajustarse de acuerdo con la cantidad de contenido (n\u00famero y tama\u00f1o de archivos) que tu sitio est\u00e1 sirviendo, la velocidad del servidor y la frecuencia con que se actualiza el sitio. Configurar registradores y monitorear los archivos resultantes te ayudar\u00e1 a afinar la configuraci\u00f3n.";
    t[9588] = "In the Network Settings sub-section, hit the <i>Settings</i> button.";
