    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "T\u00faneles construidos por otros enrutadores a trav\u00e9s de tu enrutador. Esto puede variar ampliamente dependiendo de la demanda de la red, tu ancho de banda compartido y la cantidad de tr\u00e1fico generado localmente. El m\u00e9todo recomendado para limitar los t\u00faneles de participaci\u00f3n es cambiar tu porcentaje de participaci\u00f3n en la p\u00e1gina <a href='/config'>Configuraci\u00f3n de ancho de banda</a>. Tambi\u00e9n puedes limitar el n\u00famero total estableciendo <code>router.maxParticipatingTunnels=nnn</code> en la p\u00e1gina <a href='/configadvanced'>Configuraci\u00f3n avanzada</a>. <a href='/configstats#tunnel.participatingTunnels'>[Habilitar gr\u00e1ficos]</a>.";
