    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Para configurar un servidor web alternativo para su uso en I2P, puedes usar el t\u00fanel del servidor web existente y <a href=/configclients>deshabilitar el servidor web predeterminado</a> de ejecutarse, o crear un nuevo t\u00fanel de Servidor HTTP en el <a href=/i2ptunnelmgr>Administrador de T\u00faneles</a>. Aseg\u00farate de que el <i>puerto de escucha</i> del servidor web tambi\u00e9n est\u00e9 configurado en la configuraci\u00f3n del Administrador de T\u00faneles. Por ejemplo, si tu servidor web escucha de forma predeterminada en la direcci\u00f3n 127.0.0.1 puerto 80, tambi\u00e9n deber\u00e1s asegurarte de que el <i>Puerto objetivo</i> en la p\u00e1gina de configuraci\u00f3n del servicio del Administrador de T\u00faneles tambi\u00e9n est\u00e9 configurado en el puerto 80.";
