    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Un router I2P normalmente s\u00f3lo necesita ser resembrado una vez, para unirse a la red por primera vez. Aunque si el router se ejecuta por un largo periodo sin conectividad de red, puede necesitar ser resembrado. Resembrar implica obtener m\u00faltiples archivos \"RouterInfo\" (empaquetados en un archivo zip firmado) desde al menos 2 URLs predefinidas obtenidas de un grupo de servidores HTTPS en clearnet administrados por voluntarios.";
