    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Una lista de pa\u00edses derivada del <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>Informe Mundial de Libertad</a> con una mala reputaci\u00f3n en cuanto a libertades civiles. Esta lista se usa para colocar enrutadores que funcionan en los pa\u00edses especificados en modo <i>Oculto</i> para proporcionar mayor seguridad a los usuarios. Los siguientes pa\u00edses est\u00e1n designados como estrictos: Afganist\u00e1n, Azerbaiy\u00e1n, Bar\u00e9in, Bielorrusia, Brun\u00e9i, Burundi, Camer\u00fan, Rep\u00fablica Centroafricana, Chad, China, Cuba, Rep\u00fablica Democr\u00e1tica del Congo, Egipto, Guinea Ecuatorial, Eritrea, Etiop\u00eda, Ir\u00e1n, Kazajist\u00e1n, Laos, Libia, Birmania, Corea del Norte, Territorios Palestinos, Ruanda, Arabia Saudita, Somalia, Sud\u00e1n del Sur, Sud\u00e1n, Eswatini (Swazilandia), Siria, Tayikist\u00e1n, Tailandia, Turqu\u00eda, Turkmenist\u00e1n, Venezuela, Emiratos \u00c1rabes Unidos, Uzbekist\u00e1n, Sahara Occidental, Yemen.";
