    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Cuando sea posible, aseg\u00farate de que I2P+/Java permita acceso bidirectional de puertos desde Internet configurando tu m\u00f3dem/enrutador/cortafuegos de PC correspondientemente. Si est\u00e1s detr\u00e1s de un cortafuego prohibitivo pero tienes acceso de salida sin restricciones, \u00a1I2P+ todav\u00eda puede funcionar! Puedes desactivar el acceso de entrada y confiar en <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>Detecci\u00f3n de Direcciones IP SSU</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'> perforaci\u00f3n de cortafuegos</a>) para conectarte a la red, y el estado de tu red en el panel lateral indicar\u00e1 \"Estado: Cortafuegos\". Para un rendimiento \u00f3ptimo, aseg\u00farate de que el <a href=/confignet#udpconfig>puerto externo</a> de I2P sea visible desde Internet (consulta abajo para m\u00e1s informaci\u00f3n).";
