    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "Para usar un \u00fanico conjunto de t\u00faneles para m\u00faltiples servicios cliente, los clientes se pueden configurar desde el <i>Administrador de T\u00faneles</i> para operar en modo <i>Cliente Compartido</i>. Este modo conserva recursos y mezcla el tr\u00e1fico de m\u00faltiples clientes en un \u00fanico conjunto de t\u00faneles, dificultando el an\u00e1lisis de tr\u00e1fico. Los clientes configurados como Clientes Compartidos comparten las mismas opciones de t\u00faneles.";
