    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Tu m\u00f3dem o enrutador pueden admitir <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), que permite el reenv\u00edo de puertos autom\u00e1tico. Aseg\u00farate de que el soporte UPnP est\u00e9 habilitado para I2P+ en la <a href=/confignet>p\u00e1gina de configuraci\u00f3n</a>, luego intenta activar UPnP en tu m\u00f3dem/enrutador y posiblemente tambi\u00e9n en tu computadora. Ahora intenta reiniciar el <a href=/>enrutador I2P+</a>. Si tiene \u00e9xito, I2P+ deber\u00eda informar \"Estado: OK\" en el panel lateral una vez que el enrutador I2P+ complete las pruebas iniciales de conectividad.";
