    t[11983] = "Si su puerto TCP est\u00e1 bloqueado por cortafuegos con el TCP entrante habilitado en su router, otros routers no podr\u00e1n contactar con usted a trav\u00e9s de TCP, lo que perjudicar\u00e1 a la red.";
    t[11984] = "Local Identity";
