    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "Aunque I2P funcionar\u00e1 detr\u00e1s de la mayor\u00eda de cortafuegos, las velocidades e integraci\u00f3n en la red generalmente mejorar\u00e1n si el puerto de I2P es retransmitido tanto por UDP como por TCP.";
