    t[12027] = "Preguntas frecuentes de I2P";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Si pasas el puntero sobre el encabezado <i>Informaci\u00f3n del enrutador</i>, se mostrar\u00e1 tu identidad de enrutador truncada (los primeros cuatro caracteres (24 bits) de tu huella de enrutador Base64 de 44 caracteres (256 bits)). La huella completa se muestra en tu <a href='netdb?r=.'>entrada de la base de datos de red</a>. Nunca reveles esto a nadie, ya que tu identidad de enrutador est\u00e1 vinculada de manera \u00fanica a tu direcci\u00f3n IP en la base de datos de red.";
