    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Los listados de directorios (a veces referidos como directorios virtuales) est\u00e1n habilitados de forma predeterminada, por lo que puedes alojar archivos desde un subdirectorio de <code>docroot</code> sin proveer una p\u00e1gina con enlaces a los archivos. Tambi\u00e9n puedes servir contenido que exista fuera de <code>docroot</code> mediante el uso de un <a href=https://es.wikipedia.org/wiki/Enlace_simb%C3%B3lico target=_blank rel=noreferrer class='sitelink external'>enlace simb\u00f3lico</a> al directorio deseado.";
