    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "Esta configuraci\u00f3n determina la cantidad de cubos DHT de NetDb a los que se har\u00e1 referencia cuando se ejecute el Trabajo de exploraci\u00f3n de pares. De forma predeterminada, la cantidad de cubos a explorar variar\u00e1 en funci\u00f3n de si el enrutador lleva m\u00e1s de una hora funcionando, si el enrutador est\u00e1 oculto o en la categor\u00eda de ancho de banda 'K', y la cantidad de enrutadores conocidos.";
