    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "Puede deshabilitarse en el archivo <code>clients.config</code>. Tambi\u00e9n puede configurarse para unirse a una interfaz espec\u00edfica o a todas las interfaces en el archivo <code>jetty.xml</code>.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "Puede determinar qu\u00e9 servicios se inician autom\u00e1ticamente al iniciar el enrutador, administrar la asignaci\u00f3n de t\u00faneles para optimizarlos en funci\u00f3n de los servicios de alto uso o minimizar la sobrecarga de CPU y memoria, agregar t\u00faneles de servidor y cliente para alojar o acceder a servicios en la red, establecer limitaciones de velocidad o filtrado de t\u00faneles para sus t\u00faneles de servidor y m\u00e1s.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "Se une a la direcci\u00f3n LAN. Puede cambiarse con configuraci\u00f3n avanzada <code>i2np.upnp.HTTPPort=nnnn</code>. Puede deshabilitarse en la p\u00e1gina de <a href=/confignet>Configuraci\u00f3n de red</a>.";
